import "./App.css";
import MatchPage from "./pages/matchPage";
import TeamPage from "./pages/teamPage";
import { BrowserRouter , Route , Routes} from 'react-router-dom';
imp

function App() {
  return (
    <div className="App">
      <h1>IPL Dashboard</h1>

      <BrowserRouter>
        <Routes>
          <Switch>
            <Route path="/team/:teamName" element={<TeamPage />}></Route>
            <Route path="/match/:teamName" element={<MatchPage />}></Route>
          </Switch>
        </Routes>
      </BrowserRouter>



    </div>
  );
}

export default App;
